import React from 'react';

export const Socials = () => {
    return (
        <ul>
            <li><a href='https://chastity-belt.bandcamp.com/' target='_blank'><i class="fab fa-bandcamp"></i></a></li>
            <li><a href='https://twitter.com/chast1tybelt?lang=en' target='_blank'><i class="fab fa-twitter"></i></a></li>
            <li><a href='https://www.instagram.com/chazzybelt/?hl=en' target='_blank'><i class="fab fa-instagram"></i></a></li>
            <li><a href='https://www.facebook.com/chastitybeltmusic/' target='_blank'><i class="fab fa-facebook-f"></i></a></li>
            <li><a href='https://www.patreon.com/chastitybelt' target='_blank'><i class="fab fa-patreon"></i></a></li>
            {/* <li><a href='https://open.spotify.com/artist/1tho5dJnzdYD57EQkM3SmK' target='_blank'><i class="fab fa-spotify"></i></a></li>
            <li><a href='https://music.apple.com/us/artist/chastity-belt/720263384' target='_blank'><i class="fab fa-apple"></i></a></li>
            <li><a href='https://soundcloud.com/chastity-belt' target='_blank'><i class="fab fa-soundcloud"></i></a></li> */}
        </ul>
    );
};
